import React, { Component } from 'react';
import { Link } from 'react-router-dom';
export class Home extends Component {
  render() {
    return (
      <div>
        <h1>Hello</h1>
        {data.map((category) => {
          <Link to={'/shop?category=' + category.name}>
            <img src={category.imgUrl} />
            <h1>{category.name}</h1>
          </Link>;
        })}
      </div>
    );
  }
}

export default Home;
